import React from "react";
import {BrowserRouter, NavLink, withRouter} from 'react-router-dom';
import { useHistory } from "react-router-dom";


const TopTooltip = (props) => {

  let history = useHistory();


  const postSelectedHandler = ( category ) => {
    // this.props.history.push({pathname: '/posts/' + id});
    history.push({pathname: '/shop/' + category} );
}


  return (
    <BrowserRouter>
    <ul className="shop__top-tooltip">
      <li><NavLink to={'/shop/all'}  onClick={postSelectedHandler("all")} activeClassName='is-active'><h2>all</h2></NavLink></li>
      <li><NavLink to={'/shop/ring'} onClick={postSelectedHandler("ring")} activeClassName='is-active'><h2>rings</h2></NavLink></li>
      <li><NavLink to={'/shop/necklaces'} onClick={postSelectedHandler("necklaces")} activeClassName='is-active'><h2>necklaces</h2></NavLink></li>
      <li><NavLink to={'/shop/bracelets'} onClick={postSelectedHandler("bracelets")} activeClassName='is-active'><h2>bracelets</h2></NavLink></li>
      <li><NavLink to={'/shop/earrings'} onClick={postSelectedHandler("earrings")} activeClassName='is-active'><h2>earrings</h2></NavLink></li>
    </ul>
    </BrowserRouter>
  );
};

export default withRouter(TopTooltip);
